import "../node_modules/bootstrap/dist/css/bootstrap.css"
import './App.css';
import About from "./Components/Pages/About";
import Home from "./Components/Pages/Home";
import Contact from "../Components/Page/Contact"
function App() {
  return (
    <div className="App">
      <h1>Hellow World!</h1>
      <About/>
      <Home/>
      <Contact/>
    </div>
  );
}

export default App;
